@Kongsea I checked your recent two commits, they have similar work to #8461. If you look at **layers/convolution.py**, you shall see two definitions of `Conv3DTranspose` class, because you rebased on latest master (after my PR was merged). There were no merge conflicts as they were simply additions.

To avoid duplicate definitions, you may run `git rebase -i master` by staying on your branch. It may open a text editor in the terminal and you'll see a list of these four commits. You can remove the recent two commits from that file and save it, your first two commits shall be retained while the ones with `Conv3DTranspose` code should be gone by now.

Alternatively, if you rebased just an hour ago and the master hasn't changed yet, you can run `git reset --hard HEAD~2` to remove your recent two commits and force push on this branch. But be cautious, do this step only if you haven't made a new commit locally after the rebase.
